public void sort(int[] list, int a, int b){ 
  if(a < b) { 
    int p = (a + b) / 2; 
    swap(list, p, a); 
    p = list[a]; 
    int i, j = a; 
    for(i = a + 1; i <= b; i++ ){ 
      if(list[i] > p) { 
        j++; 
        swap(list, i, j); 
      } 
    }  
    swap (list, a, j); 
    sort( list, a, j - 1 );      
    sort( list, j + 1, b ); 
  } 
} 

public void swap(int[] list, int a, int b){
  int t = list[a]; 
  list[a] = list[b]; 
  list[b] = t; 
} 
